import React from 'react'

import  ReactDOM  from 'react-dom';
import  '../../../styles/header.scss';

interface DrawerProps{
    children?: React.ReactNode;
}
const drawerHook=document.getElementById('drawer-hook') as HTMLElement
export const SideDrawerNavigation:React.FC <DrawerProps> = ({children}) => {
    el: HTMLElement = document.createElement("div");
    const content=<aside className='side-drawer'>{children}</aside>
  return ReactDOM.createPortal(content,drawerHook)
}
